    def palin(self, s):
       if s[0] == s[-1]:
               return True
       return False

    
    def longestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """
        #print(s)
        length = len(s)
        if not length or length == 1:
            return s
        longest = s[0]
        cache = set()

        short = True
        if length % 2 == 0:
            left = (length//2) - 1
            right = left + 1
        else:
            left = length//2
            right = length//2

        for wtf in range(0, length//2):
            if s[wtf] != s[length-1-wtf]:
                short = False
                break
            if s[left - wtf] != s[right + wtf]:
                short = False
                break

        if short:
            return s

        for l in range(2, length+1):
            start = 0
            end = start + l
            while end < length + 1:
                cur_s = s[start:end]
                if (cur_s in cache):
                    start += 1
                    end = start + l
                else: 
                    if cur_s[0] == cur_s[-1]:
                        if len(cur_s) <= 3 or cur_s[1:-1] in cache:
                            cache.add(cur_s)
                            longest = cur_s
                    start += 1
                    end = start + l
        
        return longest
        
            


